INSERT INTO `motel_entity` VALUES (1,1,22,'\r\n                        Đống Đa, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Chính chủ cho thuê phòng trọ khép kín mới xây thiết bị bếp nhà vệ sinh nóng lạnh mới 100% lối đi riêng khu vực dân trí cao an ninh tốt vì là ngõ cụt có sân và cổng chung ra vào tự đóng mở tiền điện nước thanh toán\r\n                ','https://img.thuephongtro.com/images/thumb/2022/10/07/20221007153048-zvst3.jpg',5,'Chính chủ cho thuê phòng trọ mới xây khép kín, thiết bị mới 100%',1),(2,1,13,'\r\n                        Ba Đình, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Cho thuê phòng: Quận Ba đình ️ Đội Cấn 2 6tr . Diện tích: 13 m2 ️ Kim Mã Thượng 3 8tr . Diện tích: 25 m2 ️ Đội Cấn 3 5tr . Diện tích: 20 m2 Nội thất có: giường đệm chăn ga tủ quần áo tủ bếp táp\r\n                ','https://img.thuephongtro.com/images/thumb/2024/03/30/20240330113028-bqlig.jpg',3,'Cho thuê phòng trọ giá rẻ bất ngờ. liên hệ ngay',1),(3,1,36,'\r\n                        Thanh Xuân, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Hot Hot Hot!!! Chính chủ cho thuê mặt bằng kinh doanh Hiện mình có 1 ki ốt cho thuê tại Kim Giang Hoàng Đạo Thành. Mặt bằng kinh doanh lô góc với 2 mặt thoáng 6m rất thu hút của mọi người đi lại. nhà nằm vị trí đắc địa\r\n            ','https://img.thuephongtro.com/images/thumb/2022/03/29/20220329083824-fbkxa.jpg',4,'Hot hot hot!!! chính chủ cho thuê mặt bằng kinh doanh giá rẻ, mặt chợ',1),(4,1,24,'\r\n                        Bắc Từ Liêm, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Cho thuê phòng trọ khép kín 24m2 full đồ. - Diện tích 24m2 có gác xép - Giường ngủ - Tủ quần áo - Điều hòa Inverter - Bình nóng lạnh - Đèn sưởi - Sen vòi tắm chậu rửa mặt - Bàn bếp chậu rửa bát - Wifi camera\r\n                ','https://img.thuephongtro.com/images/thumb/2024/01/12/20240112094543-ckmv3.jpg',2,'Cho thuê phòng trọ khép kín, giá rẻ, full đồ',1),(5,1,20,'\r\n                        Đống Đa, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Cho thuê phòng ở phố Hào Nam diện tích 20m2 công trình phụ 5m2 bếp chỗ phơi quần áo sân rộng 30m2 để xe Nhà xây để ở nên rất đẹp và sạch sẽ thoáng mát yên tĩnh. gần trung tâm thành phố Hà Nội thuận tiện cho việc đi\r\n                ','https://img.thuephongtro.com/images/thumb/2023/10/20/20231020152453-p3t52.jpg',3,'Cho thuê phòng không chung chủ ở phố hào nam',1),(6,1,20,'\r\n                        Cầu Giấy, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Có phòng 20m2 và 30m2 cho 2 nữ sinh viên trong ngõ 210 Hoàng Quốc Việt gần các trường đại học (KTQS Điện lực KHCN ĐHQG ĐHSP ĐHNN ĐHGD ..) và cao đẳng (Du lịch Sư phạm TƯ ..) gần chợ yên tĩnh an ninh sạch sẽ. Giá 3tr2. LH:\r\n         ','https://img.thuephongtro.com/images/thumb/2024/03/10/20240310114036-mxhho.jpg',3,'Cho 2 nữ sinh viên thuê phòng 20m2 ngõ 210 hoàng quốc việt',1),(7,1,25,'\r\n                        Ba Đình, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Chính chủ cho thuê phòng trọ khép kín nhà mái bằng DT 25 m2 khu dân trí cao an ninh tốt giao thông thuận tiện gần các trường ĐH Luật ĐH Ngoại thương sân Quần ngựa vườn Bách thảo... 5 phút ra Hồ Tây nhà 2 mặt tiền ô tô\r\n             ','https://img.thuephongtro.com/images/thumb/2024/01/23/20240123212924-az5n5.jpg',3,'Chính chủ cần cho thuê gấp phòng trọ khép kín ở đường văn cao',1),(8,1,25,'\r\n                        Thanh Xuân, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Cho thuê phòng Chung Cư MiNi tại Ngõ 40/8 Phố Chính Kinh (Nguyễn Trãi) Thanh Xuân - Hà Nội. - Toà nhà 8 tầng thang máy bên cạnh Royal City trung tâm tiện sinh hoạt gần chợ siêu thị ga tàu điện trên cao bãi xe và hàng loạt dịch\r\n    ','https://img.thuephongtro.com/images/thumb/2024/03/07/20240307143908-z3gzq.jpg',6,'Cho thuê phòng chung cư mini tại thanh xuân hà nội',1),(9,1,16,'\r\n                        Nam Từ Liêm, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Nhà mình mới xây xong nên CHO THUÊ PHÒNG TẠI NGÕ 322 MỸ ĐÌNH Cách sân vận động Mỹ Đình hơn 1km giao thông đi lại thuận tiện Nhà 5 tầng tổng có 8 phòng vừa mới xây và hoàn thiện xong đón đợt khách đầu tiên. Nhà ít phòng\r\n            ','https://img.thuephongtro.com/images/thumb/2024/03/05/20240305103918-5jmbo.jpg',2.5,'Mình còn 2 phòng trống full đồ nội thất mới tinh, nhà vừa xây xong, vào ở luôn',1),(10,1,30,'\r\n                        Bắc Từ Liêm, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Phòng trọ Xuân Đỉnh tầng 5 chung thang bộ với chủ nhà gần công viên Hòa Bình 3 1 triệu/30m2 điện-nước giá nhà nước Cho NGƯỜI ĐÃ ĐI LÀM KHÔNG HÚT THUỐC thuê phòng trọ tầng 5 (chung thang bộ với chủ nhà) gồm 1 phòng ở 1 phòng bếp\r\n   ','https://img.thuephongtro.com/images/thumb/2024/01/06/20240106175503-m51mt.jpg',3,'Phòng trọ t5 chung thangbộ với chủ 3,1 triệu/30m2 điện nước giá nhànước',1),(11,1,30,'\r\n                        Đống Đa, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Chính chủ cho thuê căn hộ tầng 2 nhà A4 khu TT Nam Đồng diện tích 30m2 công trình phụ khép kín. Nhà sạch sẽ thoáng mát trang thiết bị cơ bản: phạt trần bình nước nóng thiết bị vs gắn tường. Gần chợ và trường học các cấp từ\r\n        ','https://img.thuephongtro.com/images/thumb/2022/08/10/20220810113033-1d1no.jpg',4,'Cho thuê căn hộ ktt nam đồng-30m2-có điều hòa-ctp khép kín-gần các trường đh nh, công đoàn, thủy lợi',1),(12,1,18,'\r\n                        Long Biên, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Chính chủ có phòng 18m2 tầng 2 trong nhà 3 tầng lâu dài. Có điều hòa nóng lạnh intenet máy giặt bếp nấu ăn sân để xe tủ quần áo nệm. An ninh tốt điện nc giá nhà nước giờ giấc tự do. cách bến xe buys 3p đi bộ\r\n                ','https://img.thuephongtro.com/images/thumb/2024/01/16/20240116013913-2qcnw.jpg',2,'Chính chủ cho thuê phòng ngõ 9 ô cách đức giang long biên hà nội',1),(13,1,25,'\r\n                        Thanh Xuân, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Vị trí : nằm sát đường Hoàng Đạo Thành và Nguyễn xiện với nhà góc phân lô 2 mặt thoáng cửa sổ ban công rộng dãi ô tô đỗ sát nhà. Tiện ích: có chợ cóc dưới chân tòa nhà họp từ sáng tới trưa. có bãi gửi ô tô\r\n                ','https://img.thuephongtro.com/images/thumb/2020/05/18/20200518151010-qj35o.jpg',2.5,'Cho thuê phòng chỉ 3,6 tr, dt 25m full đồ giá rẻ mới tính 100%',1),(14,1,25,'\r\n                        Thanh Xuân, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Vị trí : nằm sát đường Hoàng Đạo Thành và Nguyễn xiện với nhà góc phân lô 2 mặt thoáng cửa sổ ban công rộng dãi ô tô đỗ sát nhà. Tiện ích: có chợ cóc dưới chân tòa nhà họp từ sáng tới trưa. có bãi gửi ô tô\r\n                ','https://img.thuephongtro.com/images/thumb/2020/03/23/20200323101841-ujhvm.jpg',4,'Chỉ nhỉnh 4tr vào ở ngay ccmn full đồ mới toanh , ban công của sổ thoáng mát tại thanh xuân',1),(15,1,30,'\r\n                        Hai Bà Trưng, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Chính chủ cho thuê tại phố Dương văn Bé Vĩnh Tuy khép kín đồ cơ bản. hiện mình có 1 phòng cho thuê tại phố Dương vắn bé sát time city. phòng có diện tích 30 khép kín được chia làm 3 khu vực gồm khu vệ sinh khu phòng\r\n               ','https://img.thuephongtro.com/images/thumb/2022/07/06/20220706084012-rrpuc.jpg',3,'Cho thuê phòng tại vĩnh tuy , khép kín điều hòa nóng lạnh giá rẻ chỉ nhỉnh 2tr',1),(16,1,32,'\r\n                        Thanh Xuân, Hà Nội\r\n                    ',1,NULL,NULL,'\r\n                     Cho thuê CCMN tại Kim Giang thoáng mát ban cồn rộng nội thất mới. Hiện tại mình có 1 phòng tại ngõ 64 Kim Giang với lỗi đi lại thuận tiện 200m đi thông ra Nguyễn Xiển sát đường Hoàng Đạo Thành nhà thuộc lô góc thuận tiền đi lại\r\n   ','htt